import { Routes } from './Routes'

interface Props {

}

export const App: React.FC<Props> = () => {
    const [loading, setLoading] = useState(true);
    if(loading){
        return <div>
            loading ...
        </div>;
    }

    useEffect(() => {
        fetch ('http://localhost:4000/refresh_token', {
            method: "POST",
            credentials: "include"
        }).then(async x => {
            const data = x.json();
            console.log(data);
            }
        );
        setLoading(false)
    }, [])

    return <Routes/>
}
